import { Key } from '@mui/icons-material';
import React from 'react'
import { useEffect } from 'react';
import { useState } from 'react';
import { getAllDishes } from '../../services/dish';
import Dish from './Dish';


function ListDish() {
    const [dish, setDish] = useState([]);

    useEffect(() => {
        getAllDishes()
            .then((res) => {
                setDish(res)
            })
            .catch((error) => {
                console.log(error);
            })
    }, [])



    return (
        <div className='container'>
            <table id="customers">
                <tr>
                    <th>Name</th>
                    <th>Desc</th>
                    <th>Category</th>
                    <th>Sub Category</th>
                    <th>Price</th>
                    <th>Status</th>
                    <th>Actions</th>
                </tr>
                {dish.map((val, index) => {
                    return <Dish dish={val} Key={index}/>
                })}
            </table>
        </div>
    )
}

export default ListDish
